import React, { Component } from "react";

import data from "./data/data.json";


const newdata = data.map(data => {
  return (
    <div>
     <div>{data.name}</div>
     <svg>
       <path stroke="black" />
      </svg>
    </div>
  );
});

export default class Main extends Component {
  render() {
    return newdata;
  }
}
